function svg(w, h, path) {
    let ret = document.createElement("svg");
    ret.setAttribute("viewBox", `0 0 ${w} ${h}`);
    ret.setAttribute("xmlns", "http://www.w3.org/2000/svg");
    let p = document.createElement("path");
    p.setAttribute("d", path);
    ret.appendChild(p);
    return ret;
}

window.onload = function() {
    for (let el of Array.from(document.getElementsByTagName("i"))) {
        let fs = window.getComputedStyle(el).fontSize;
        let fc = window.getComputedStyle(el).color;
        let svg = window.ICON[el.classList.item(0)].cloneNode(true);
        svg.style.width = fs;
        svg.style.height = fs;
        svg.firstChild.setAttribute("fill", fc);
        el.appendChild(svg);
    }
    setTimeout(() => {
        for (let el of Array.from(document.getElementsByTagName("svg"))) el.parentElement.innerHTML += " ";
    }, 10);
}

